          <TableHead>
            <TableRow sx={{ backgroundColor: grey[200] }}>
              <TableCell align="center">Start Date</TableCell>
              <TableCell align="center" sx={hideColumn}>
                End Date
              </TableCell>
              <TableCell align="center">Name</TableCell>
              <TableCell align="center">Location</TableCell>
              <TableCell align="center">Division</TableCell>
              <TableCell align="center">Purse</TableCell>
              <TableCell align="center">Coverage</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            <PopulateTable rows={rows}></PopulateTable>
          </TableBody>
        </Table>
      </TableContainer>
    </React.Fragment>
  );

  const past = (
    <React.Fragment>
      <Typography variant="h5" align="center" gutterBottom>
        Past Tournaments
      </Typography>
      <TableContainer component={Paper}>
        <Table aria-label="Past Tournaments">
          <TableHead>
            <TableRow sx={{ backgroundColor: grey[200] }}>
              <TableCell align="center">Start Date</TableCell>
              <TableCell align="center">End Date</TableCell>
              <TableCell align="center">Name</TableCell>
              <TableCell align="center">Location</TableCell>
              <TableCell align="center">Division</TableCell>
              <TableCell align="center">Purse</TableCell>
              <TableCell align="center">Coverage</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            <PopulateTable rows={rows}></PopulateTable>
          </TableBody>
        </Table>
      </TableContainer>
    </React.Fragment>
  );

  const container =
    window !== undefined ? () => window().document.body : undefined;

  return (
    <Box sx={{ display: "flex" }}>
      <CssBaseline />
      {header}
      <Box
        component="nav"
        sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}
        aria-label="Channels"
      >
        <Drawer //mobile display
          container={container}
          variant="temporary"
          open={mobileOpen}
          onClose={handleDrawerToggle}
          ModalProps={{
            keepMounted: true, // Better open performance on mobile according to MUI template.
          }}
          sx={{
            display: { xs: "block", sm: "none" },
            "& .MuiDrawer-paper": {
              boxSizing: "border-box",
              width: drawerWidth,
            },
          }}
        >
          {drawer}
        </Drawer>
        <Drawer //large display
          variant="permanent"
          sx={{
            display: { xs: "none", sm: "block" },
            "& .MuiDrawer-paper": {
              boxSizing: "border-box",
              width: drawerWidth,
            },
          }}
          open
        >
          {drawer}
        </Drawer>
      </Box>
      <Box
        component="main"
        sx={{
          flexGrow: 1,
          p: 3,
          width: { sm: `calc(100% - ${drawerWidth}px)` },
        }}
      >
        <Toolbar />

        {upcoming}
        <Toolbar />

        {past}
        <Toolbar />
        {footer}
      </Box>
    </Box>
  );
};

export default App;
